import fetch from "./Fetches";

class App extends React.Component {
  componentDidMount() {
    this.fetchData();
  }
  fetchData = async () => {
    await fetch().forEach(async doc => {
      await (
          (`${doc.id} => ${doc.data().Name}`)
      );
    });
  };
  render() {
    return <div>HI</div>;
  }
}

export default App;
